CREATE SEQUENCE catalogoservice_item_iditem_seq
START WITH 1
INCREMENT BY 50
MINVALUE 1
NO MAXVALUE
CACHE 1;

CREATE TABLE IF NOT EXISTS item (
    iditem integer NOT NULL,
    version integer,
    codigo character varying(255),
    cor character varying(255),
    designacao character varying(255),
    disponibilidade character varying(255),
    estilo character varying(255),
    imagem character varying(255),
    nr_disponiveis integer NOT NULL,
    nraquisicoes integer NOT NULL,
    preco double precision,
    tipo character varying(255),
    lojaidloja integer NOT NULL,
    CONSTRAINT item_pkey PRIMARY KEY (iditem),
    CONSTRAINT fkitem395030 FOREIGN KEY (lojaidloja) REFERENCES loja (idloja)
);



SELECT setval('"catalogoservice_item_iditem_seq"', (SELECT MAX(iditem) from item));

CREATE TABLE IF NOT EXISTS peca (
    tamanho character varying(255),
    itemiditem integer NOT NULL,
    CONSTRAINT peca_pkey PRIMARY KEY (itemiditem),
    CONSTRAINT fkhywtek3orp603rultmhcyabg5 FOREIGN KEY (itemiditem) REFERENCES item (iditem)
);



CREATE TABLE IF NOT EXISTS "set" (
    nr_pecas integer NOT NULL,
    tamanho character varying(255),
    itemiditem integer NOT NULL,
    CONSTRAINT set_pkey PRIMARY KEY (itemiditem),
    CONSTRAINT fkjs26seqduyypausfmk3p8y281 FOREIGN KEY (itemiditem) REFERENCES item (iditem)
);


CREATE TABLE IF NOT EXISTS set_peca (
    peca_itemiditem integer NOT NULL,
    set_itemiditem integer NOT NULL,
    CONSTRAINT set_peca_pkey PRIMARY KEY (peca_itemiditem, set_itemiditem),
    CONSTRAINT fkafkbb3mg8fbyassutlr02o2kx FOREIGN KEY (peca_itemiditem) REFERENCES peca (itemiditem),
    CONSTRAINT fkcic43882h9qvxr18uvtkdqpsj FOREIGN KEY (set_itemiditem) REFERENCES "set" (itemiditem)
);


CREATE TABLE IF NOT EXISTS calcado (
    numero integer NOT NULL,
    itemiditem integer NOT NULL,
    CONSTRAINT calcado_pkey PRIMARY KEY (itemiditem),
    CONSTRAINT fkavq8rwqjjjkepig9hs0qk5p32 FOREIGN KEY (itemiditem) REFERENCES item (iditem)
);


